def predict(triples: list[Triple]) -> str:
    sentence = ""
    for i, triple in enumerate(triples):
        if triple.predicate == "cityServed":
            sentence += f"{triple.subject} serves the city of {triple.object}"
        elif triple.predicate == "country":
            sentence += f", which is located in {triple.object}"
        elif triple.predicate == "capital":
            sentence += f", with {triple.subject} being its capital"
        elif triple.predicate == "elevationAboveTheSeaLevel":
            sentence += f", having an elevation of {triple.object} meters"
        elif triple.predicate == "location":
            sentence += f", located in {triple.object}"
        elif triple.predicate == "operatingOrganisation":
            sentence += f", operated by {triple.object}"
        elif triple.predicate == "runwayLength":
            sentence += f", with a runway length of {triple.object} meters"
        elif triple.predicate == "runwayName":
            sentence += f", featuring a runway named {triple.object}"
        elif triple.predicate == "isPartOf":
            sentence += f", and is part of {triple.object}"
        elif triple.predicate == "1stRunwayLengthFeet":
            sentence += f", its first runway being {triple.object} feet long"
        elif triple.predicate == "1stRunwaySurfaceType":
            sentence += f", with its first runway surface being {triple.object}"
        elif triple.predicate == "3rdRunwayLengthFeet":
            sentence += f", and its third runway is {triple.object} feet long"
        elif triple.predicate == "icaoLocationIdentifier":
            sentence += f", identified as {triple.object} by ICAO"
        elif triple.predicate == "locationIdentifier":
            sentence += f", identified as {triple.object}"
        elif triple.predicate == "elevationAboveTheSeaLevelInFeet":
            sentence += f", at an elevation of {triple.object} feet"
        elif triple.predicate == "iataLocationIdentifier":
            sentence += f", identified as {triple.object} by IATA"
        elif triple.predicate == "nativeName":
            sentence += f", also known as {triple.object}"
        elif triple.predicate == "leaderParty":
            sentence += f", led by the {triple.object}"
        elif triple.predicate == "language":
            sentence += f", where {triple.object} is spoken"
        elif triple.predicate == "owner":
            sentence += f", owned by {triple.object}"
        elif triple.predicate == "1stRunwayLengthMetre":
            sentence += f", with its first runway measuring {triple.object} meters"
        elif triple.predicate == "4thRunwaySurfaceType":
            sentence += f", and its fourth runway surface is {triple.object}"
        elif triple.predicate == "largestCity":
            sentence += f", the largest city being {triple.object}"
        elif triple.predicate == "4thRunwayLengthFeet":
            sentence += f", and the fourth runway is {triple.object} feet long"
        elif triple.predicate == "elevationAboveTheSeaLevelInMetres":
            sentence += f", having an elevation of {triple.object} meters"
