            sentence += f", situated in the {triple.object}"
        elif triple.predicate == "officialLanguage":
            sentence += f", with {triple.object} as its official language"
        elif triple.predicate == "regionServed":
            sentence += f", serving the region of {triple.object}"
        else:
            sentence += f", and {triple.subject} {triple.predicate} {triple.object}"

        if i == 0:
            sentence = sentence.replace(", ", " ")
    return sentence

